import { HStack, Heading, Image } from "@chakra-ui/react";

export const Header = () => {
  return (
    <HStack spacing={5}>
      <Image src="icon.png" boxSize={12} borderRadius={15} />
      <Heading color="brand" fontWeight="semibold">
        tomotime
      </Heading>
    </HStack>
  );
};
